Text: # TDC A/S _(incorporated as a public limited company in Denmark)_ ### €4,000,000,000 Euro Medium Term Note Programme This Base Prospectus, which comprises a base prospectus for the purposes of Article 5.4 of the Prospectus Directive (as defined herein), has been approved by the Luxembourg _Commission de Surveillance du Secteur Financier (the "CSSF"), which is the Luxembourg competent authority for the purpose of the Prospectus Directive and relevant implementing measures in Luxembourg, as a base prospectus issued in compliance with the Prospectus Directive and relevant implementing measures in Luxembourg for the purpose of giving information with regard to the issue of notes ("Notes") issued under the Euro Medium Term Note Programme (the "Programme") described in this Base Prospectus during the period of twelve months after the date hereof. The CSSF assumes no responsibility with regards to the economic and financial soundness of any transaction under the Programme or the quality and solvency of the Issuer in accordance with the provisions of article 7(7) of the Luxembourg Act dated 10 July 2005 relating to prospectuses for securities (loi relative aux prospectus pour valeurs mobilières). Applications have been made for such Notes to be admitted during the period of twelve months after the date hereof to listing on the official list and to trading on the regulated market of the Luxembourg Stock Exchange. The Programme also permits Notes to be issued on the basis that they will not be admitted to listing, trading and/or quotation by any competent authority, stock exchange and/or quotation system or to be admitted to listing, trading and/or quotation by such other or further competent authorities, stock exchanges and/or quotation systems as may be agreed with TDC A/S (the "Issuer" or "TDC"). Tranches of Notes (as defined herein) may be rated or unrated. Where a Tranche of Notes is rated, such rating will not necessarily be the same as the ratings described below or the rating(s) assigned to Notes already issued. Where a Tranche of Notes is rated, the applicable rating(s) will be specified in the relevant Final Terms (as defined herein). Whether or not each credit rating applied for in relation to a relevant Tranche of Notes will be (1) issued by a credit rating agency established in the EEA and registered (or which has applied for registration and not been refused) under Regulation (EU) No 1060/2009, as amended (the "CRA Regulation") or (2) issued by a credit rating agency which is not established in the EEA but will be endorsed by a credit rating agency which is established in the EEA and registered under the CRA Regulation or (3) issued by a credit rating agency which is not established in the EEA but which is certified under the CRA Regulation will be disclosed in the Final Terms. In general, European regulated investors are restricted from using a rating for regulatory purposes if such rating is not issued by a credit rating agency established in the EEA and registered under the CRA Regulation unless (1) the rating is provided by a credit rating agency operating in the EEA before 7 June 2010 which has submitted an application for registration in accordance with the CRA Regulation and such registration has not been refused, or (2) the rating is provided by a credit rating agency not established in the EEA but is endorsed by a credit rating agency established in the EEA and registered under the CRA Regulation or (3) the rating is provided by a credit rating agency not established in the EEA which is certified under the CRA Regulation. A rating is not a recommendation to buy, sell or hold Notes and may be subject to suspension, change or withdrawal at any time by the assigning rating agency. The Notes may be issued on a continuing basis to one or more of the Dealers specified under "Overview", and any additional Dealer appointed under the Programme from time to time by the Issuer (each a "Dealer" and together the "Dealers"), which appointment may be for a specific issue or on an ongoing basis. References in this Base Prospectus to the "Relevant Dealer" shall, in the case of an issue of Notes being (or intended to be) subscribed by more than one Dealer, be to all Dealers agreeing to subscribe to such Notes. _Investing in Notes issued under the Programme involves certain risks. The principal risk factors that may affect the ability of the Issuer to fulfil its obligations under the Notes are discussed in the "Risk Factors" section below._

