xtent (if at all) specified in the relevant Final Terms. Tax Redemption:** Except as described in "Optional Redemption" above, early redemption will only be permitted for tax reasons as described in Condition 10(b) (‎ _Redemption and Purchase — Redemption for tax _reasons)._ Interest:** Notes may be interest-bearing or non-interest bearing. Interest (if any) may accrue at a fixed rate or a floating rate or other variable ----- rate or be index-linked and the method of calculating interest may vary between the issue date and the maturity date of the relevant Series. Denominations:** No Notes may be issued under the Programme which, in the case of any Notes which are to be admitted to trading on a regulated market within the European Economic Area or offered to the public in a Member State of the European Economic Area in circumstances which would otherwise require the publication of a prospectus under the Prospectus Directive, have a minimum denomination of less than €100,000‎(or‎its‎equivalent‎in‎any‎other‎currency‎as‎at‎the‎date‎of‎ issue of the Notes). Subject thereto, Notes will be issued in such denominations as may be specified in the relevant Final Terms, subject to compliance with all applicable legal and/or regulatory and/or central bank requirements. Negative Pledge:** The Notes will have the benefit of a negative pledge as described in Condition 5 (‎ _Negative Pledge). Cross Default:** The Notes will have the benefit of a cross default as described in Condition 14 (‎ _Events of Default). Taxation:** All payments in respect of Notes will be made free and clear of withholding taxes of Denmark unless the withholding is required by law. In that event, the Issuer will (subject as provided in Condition 13 (‎ _Taxation)) pay such additional amounts as will result in the Noteholders receiving such amounts as they would have received in respect of such Notes had no such withholding been required. Governing Law:** English law. Ratings:** Notes issued under the Progr