or central bank requirements. Payments in respect of Notes may, subject to such compliance, be made in and/or linked to, any currency or currencies other than the currency in which such Notes are denominated. Status of the Notes:** Notes will be issued on an unsubordinated basis. Issue Price:** Notes may be issued at any price, as specified in the relevant Final Terms. The price and amount of Notes to be issued under the Programme will be determined by the Issuer and the relevant Dealer(s) at the time of issue in accordance with prevailing market conditions. Maturities:** Any maturity, subject, in relation to specific currencies, to compliance with all applicable legal and/or regulatory and/or central bank requirements. Where Notes have a maturity of less than one year and either (a) the issue proceeds are received by the Issuer in the United Kingdom or (b) the activity of issuing the Notes is carried on from an establishment maintained by the Issuer in the United Kingdom, such Notes must: (i) have a minimum redemption value of £100,000 (or its equivalent in other currencies) and be issued only to persons whose ordinary activities involve them in acquiring, holding, managing or disposing of investments (as principal or agent) for the purposes of their businesses or who it is reasonable to expect will acquire, hold, manage or dispose of investments (as principal or agent) for the purposes of their businesses; or (ii) be issued in other circumstances which do not constitute a contravention of section 19 of the FSMA by the Issuer. Redemption:** Notes may be redeemable at par or at such other Redemption Amount (detailed in a formula, index or otherwise) as may be specified in the relevant Final Terms. Notes may also be redeemable on such dates and in such manner as may be specified in the relevant Final Terms. Optional Redemption:** Notes may be redeemed before their stated maturity at the option of the Issuer (either in whole or in part) and/or the Noteholders to the extent (if at all) specified in the relevant Final Terms. Tax Redemption:** Except as described in "Optional Redemption" above, early redemption will only be permitted for tax reasons as described in Condition 10(b) (‎ _Redemption and Purchase — Redemption for tax _reasons)._ Interest:** Notes may be interest-bearing or non-interest bearing. Interest (if any) may accrue at a fixed rate or a floating rate or other variable ----- rate or be index-linked and the method of calculating interest may vary between the issue date and the maturity date of the relevant Series. Denominations:** No Notes may be issued under the Programme which, in the case of any Notes which are to be admitted to trading on a regulated market within the European Economic Area or offered to the public in a Member State of the European Economic Area in circumstances which would otherwise require the publication of a prospectus under the Prospectus Directive, have a minimum denomination of less than €100,000‎(or‎its‎equivalent‎in‎any‎other‎currency‎as‎at‎the‎date‎of‎ issue of the Notes). Subject thereto, Notes will be issued in such denominations as may be specified in the relevant Final Terms, subject to compliance with all applicable legal and/or regulatory and/or central bank requirements. Negative Pledge:** The Notes will have the benefit of a negative pledge as described in Condition 5 (‎ _Negative Pledge). Cross Default:** The Notes will have the benefit of a cross default as described in Condition 14 (‎ _Events of Default). Taxation:** All payments in respect of Notes will be made free and clear of withholding taxes of Denmark unless the withholding is required by law. In that event, the Issuer will (subject as provided in Condition 13 (‎ _Taxation)) pay such additional amounts as will result in the Noteholders receiving such amounts as they would have received in respect of such Notes had no such withholding been required. Governing Law:** English law. Ratings:** Notes issued under the Programme may be rated or unrated. The Programme has been rated as follows: Fitch Ratings Limited ("Fitch"): BBB Moody’s‎Investors‎Service‎España,‎S.A.‎("Moody's"): Baa2 Standard & Poor's Credit Market Services Europe Limited ("Standard & Poor's"): BBB In general, European regulated investors are restricted under the CRA Regulation from using a credit rating for regulatory purposes if such rating is not issued by a credit rating agency established in the EEA and registered under the CRA Regulation unless (1) the rating is provided by a credit rating agency operating in the EEA before 7 June 2010 which has submitted an application for registration in accordance with the CRA Regulation and such registration has not been refused, or (2) the rating is provided by a credit rating agency not established in the EEA but is endorsed by a credit rating agency established in the EEA and registered under the CRA Regulation or (3) the rating is provided by a credit rating agency not established in the EEA which is certified under the CRA Regulation. Fitch,‎ Moody's‎ and‎ Standard‎ &‎ Poor’s‎ are‎ established‎ in‎ the‎ EEA and registered under the CRA Regulation and are included in the list of registered credit rating agencies published by the European Securities and Markets Authority ("ESMA") on its website in accordance with the CRA Regulation. -----

