Title: TDC’s related pension funds
Text: Some of TDC's present and former employees are entitled to a pension from TDC Pension Fund, the fund related to TDC. The TDC Pension Fund is a separate legal entity supervised by the Danish Financial Supervisory Authority (FSA) where TDC as the sponsor is obliged to cover any regulatory shortfall in the pension‎fund’s‎ability‎to‎comply‎ with‎the‎capital‎adequacy requirements under the Corporate Pension Funds Act. TDC also operates defined benefits plans that cover employees of TDC Norway. The risk of additional capital contributions having to be made in respect of the TDC Pension Fund can be categorized by investment, longevity and regulatory risks. Investment risk is managed within risk tolerance limits to mitigate excessive risk which could lead to contribution. The fund invests in a wide variety of marketable securities (predominantly fixed income securities)‎and‎the‎return‎on‎the‎investments‎has‎implications‎for‎TDC’s‎financial‎results.‎Uncompensated‎ risk related to nominal rates and inflation has been fully hedged. Following‎ the‎ introduction‎ of‎ the‎ longevity‎ benchmark‎ by‎ the‎ Danish‎ FSA,‎ the‎ fund’s‎ actuary has conducted a detailed longevity statistical analysis which‎ has‎ underpinned‎ the‎ fund’s‎ assumptions‎ regarding observed current longevity. The fund has however, in line with the sector increased its provision for future expected improvements to longevity. ----- Other risk of capital contribution in excess of the planned ordinary contributions and extraordinary contributions in connection with redundancies going forward relate primarily to future changes to pension regulation and benefits which TDC does not have control over. TDC has formed a Pension Fund Advisory team located within the TDC Group Treasury which continuously manages investment decisions and the financial risks related to the fund on behalf of TDC.

