Title: The Notes may not be a suitable investment for all investors
Text: Each potential investor in the Notes must determine the suitability of that investment in light of its own circumstances. In particular, each potential investor should: (i) have sufficient knowledge and experience to make a meaningful evaluation of the Notes, the merits and risks of investing in the Notes and the information contained or incorporated by reference in this Base Prospectus or any applicable supplement; (ii) have access to, and knowledge of, appropriate analytical tools to evaluate, in the context of its particular financial situation, an investment in the Notes and the impact the Notes will have on its overall investment portfolio; (iii) have sufficient financial resources and liquidity to bear all of the risks of an investment in the Notes, including Notes with principal or interest payable in one or more currencies, or where the currency for principal or interest payments is different from the potential investor's currency; (iv) understand thoroughly the terms of the Notes and be familiar with the behaviour of any relevant indices and financial markets; and (v) be able to evaluate (either alone or with the help of a financial adviser) possible scenarios for economic, interest rate and other factors that may affect its investment and its ability to bear the applicable risks. Some Notes are complex financial instruments. Sophisticated institutional investors generally do not purchase complex financial instruments as standalone investments. They purchase complex financial instruments as a way to reduce risk or enhance yield with an understood, measured, appropriate addition of risk to their overall portfolios. A potential investor should not invest in Notes which are complex financial instruments unless it has the expertise (either alone or with a financial adviser) to evaluate how the Notes will perform under changing conditions, the resulting effects on the value of the Notes and the impact this investment will have on the potential investor's overall investment portfolio.

