Title: Index Linked Notes and Dual Currency Notes
Text: The Issuer may issue Notes with principal or interest determined by reference to an index or formula, to changes in the prices of securities or commodities, to movements in currency exchange rates or other factors (each, a "Relevant Factor"). In addition, the Issuer may issue Notes with principal or interest payable in one or more currencies which may be different from the currency in which the Notes are denominated. Potential investors should be aware that: (i) the market price of such Notes may be volatile; (ii) they may receive no interest; (iii) payment of principal or interest may occur at a different time or in a different currency than expected; (iv) they may lose all or a substantial portion of their principal; ----- (v) a Relevant Factor may be subject to significant fluctuations that may not correlate with changes in interest rates, currencies or other indices; (vi) if a Relevant Factor is applied to Notes in conjunction with a multiplier greater than one or contains some other leverage factor, the effect of changes in the Relevant Factor on principal or interest payable likely will be magnified; and (vii) the timing of changes in a Relevant Factor may affect the actual yield to investors, even if the average level is consistent with their expectations. In general, the earlier the change in the Relevant Factor, the greater the effect on yield. The historical experience of an index should not be viewed as an indication of the future performance of such index during the term of any index linked notes. Accordingly, each potential investor should consult its own financial and legal advisers about the risk entailed by an investment in any index linked notes and the suitability of such Notes in light of its particular circumstances.

