Title: Zero Coupon Notes
Text: Zero coupon notes do not pay current interest but are issued at a discount from their nominal value. Instead of periodic interest payments, the difference between the redemption price and the issue price constitutes interest income until maturity and reflects the market interest rate. A holder of zero coupon notes is exposed to the risk that the price of such notes falls as a result of changes in the market interest rate. Prices of zero coupon notes are more volatile than prices of fixed rate notes and are likely to respond to a greater degree to market interest rate changes than interest bearing notes with a similar maturity.

