Title: Fixed/floating rate Notes
Text: Fixed/floating rate Notes may bear interest at a rate that converts from a fixed rate to a floating rate or from a floating rate to a fixed rate. Where the Issuer has the right to effect such a conversion, this will affect the secondary market and the market value of the Notes since the Issuer may be expected to convert the rate when it is likely to produce a lower overall cost of borrowing. If the Issuer converts from a fixed rate to a floating rate in such circumstances, the spread on the fixed/floating rate Notes may be less favourable than then prevailing spreads on comparable floating rate Notes tied to the same reference rate. In addition, the new floating rate at any time may be lower than the rates on other Notes. If the Issuer converts from a floating rate to a fixed rate in such circumstances, the fixed rate may be lower than then prevailing rates on its Notes.

