Title: Inverse floating rate Notes
Text: Inverse floating rate Notes have an interest rate equal to a fixed rate minus a rate based upon a reference rate such as LIBOR. The market values of those Notes typically are more volatile than market values of other conventional floating rate debt securities based on the same reference rate (and with otherwise comparable terms). Inverse floating rate Notes are more volatile because an increase in the reference rate not only decreases the interest rate of the Notes, but may also reflect an increase in prevailing interest rates, which further adversely affects the market value of these Notes.

