Title: Temporary Global Note exchangeable for Permanent Global Note
Text: If the relevant Final Terms specifies the form of Notes as being "Temporary Global Note exchangeable for a Permanent Global Note", then the Notes will initially be in the form of a Temporary Global Note which will be exchangeable, in whole or in part, for interests in a Permanent Global Note, without interest coupons, not earlier than 40 days after the issue date of the relevant Tranche of the Notes upon certification as to non-U.S. beneficial ownership. No payments will be made under the Temporary Global Note unless exchange for interests in the Permanent Global Note is improperly withheld or refused. In addition, interest payments in respect of the Notes cannot be collected without such certification of nonU.S. beneficial ownership. Whenever any interest in the Temporary Global Note is to be exchanged for an interest in a Permanent Global Note, the Issuer shall procure (in the case of first exchange) the delivery of a Permanent Global Note to the bearer of the Temporary Global Note or (in the case of any subsequent exchange) an increase in the principal amount of the Permanent Global Note in accordance with its terms against: (i) presentation and (in the case of final exchange) presentation and surrender of the Temporary Global Note to or to the order of the Fiscal Agent; and (ii) receipt by the Fiscal Agent of a certificate or certificates of non-U.S. beneficial ownership. The principal amount of Notes represented by the Permanent Global Note shall be equal to the aggregate of the principal amounts specified in the certificates of non-U.S. beneficial ownership provided, however, _that in no circumstances shall the principal amount of Notes represented by the Permanent Global Note_ exceed the initial principal amount of Notes represented by the Temporary Global Note. If: (a) the Permanent Global Note has not been delivered or the principal amount thereof increased by 5.00 p.m. (London time) on the seventh day after the bearer of the Temporary Global Note has requested exchange of an interest in the Temporary Global Note for an interest in a Permanent Global Note; or ----- (b) the Temporary Global Note (or any part thereof) has become due and payable in accordance with the Terms and Conditions of the Notes or the date for final redemption of the Temporary Global Note has occurred and, in either case, payment in full of the amount of principal falling due with all accrued interest thereon has not been made to the bearer of the Temporary Global Note in accordance with the terms of the Temporary Global Note on the due date for payment, then the Temporary Global Note (including the obligation to deliver a Permanent Global Note) will become void at 5.00 p.m. (London time) on such seventh day (in the case of (a) above) or at 5.00 p.m. (London time) on such due date (in the case of (b) above) and the bearer of the Temporary Global Note will have no further rights thereunder (but without prejudice to the rights which the bearer of the Temporary Global Note or others may have under the Deed of Covenant). The Permanent Global Note will become exchangeable, in whole but not in part only and at the request of the bearer of the Permanent Global Note, for Bearer Notes in definitive form ("Definitive Notes") if Euroclear or Clearstream, Luxembourg or any other relevant clearing system is closed for business for a continuous period of 14 days (other than by reason of legal holidays) or announces an intention permanently to cease business. Whenever the Permanent Global Note is to be exchanged for Definitive Notes, the Issuer shall procure the prompt delivery (free of charge to the bearer) of such Definitive Notes, duly authenticated and with Coupons and Talons attached (if so specified in the Final Terms), in an aggregate principal amount equal to the principal amount of Notes represented by the Permanent Global Note to the bearer of the Permanent Global Note against the surrender of the Permanent Global Note to or to the order of the Fiscal Agent within 30 days of the bearer requesting such exchange. If: (a) Definitive Notes have not been duly delivered by 5.00 p.m. (London time) on the thirtieth day after the bearer has requested exchange of the Permanent Global Note for Definitive Notes; or (b) the Permanent Global Note was originally issued in exchange for part only of a Temporary Global Note representing the Notes and such Temporary Global Note becomes void in accordance with its terms; or (c) the Permanent Global Note (or any part thereof) has become due and payable in accordance with the Terms and Conditions of the Notes or the date for final redemption of the Permanent Global Note has occurred and, in either case, payment in full of the amount of principal falling due with all accrued interest thereon has not been made to the bearer in accordance with the terms of the Permanent Global Note on the due date for payment, then the Permanent Global Note (including the obligation to deliver Definitive Notes) will become void at 5.00 p.m. (London time) on such thirtieth day (in the case of (a) above) or at 5.00 p.m. (London time) on the date on which such Temporary Global Note becomes void (in the case of (b) above) or at 5.00 p.m. (London time) on such due date ((c) above) and the bearer of the Permanent Global Note will have no further rights thereunder (but without prejudice to the rights which the bearer of the Permanent Global Note or others may have under the Deed of Covenant).

