Text: If the relevant Final Terms specifies the form of Notes as being "Temporary Global Note exchangeable for Definitive Notes" and also specifies that the TEFRA C Rules are applicable or that neither the TEFRA C Rules or the TEFRA D Rules are applicable, then the Notes will initially be in the form of a Temporary Global Note which will be exchangeable, in whole but not in part, for Definitive Notes not earlier than 40 days after the issue date of the relevant Tranche of the Notes. If the relevant Final Terms specifies the form of Notes as being "Temporary Global Note exchangeable for Definitive Notes" and also specifies that the TEFRA D Rules are applicable, then the Notes will initially be in the form of a Temporary Global Note which will be exchangeable, in whole or in part, for Definitive Notes not earlier than 40 days after the issue date of the relevant Tranche of the Notes upon certification as to non-U.S. beneficial ownership. Interest payments in respect of the Notes cannot be collected without such certification of non-U.S. beneficial ownership. ----- Whenever the Temporary Global Note is to be exchanged for Definitive Notes, the Issuer shall procure the prompt delivery (free of charge to the bearer) of such Definitive Notes, duly authenticated and with Coupons and Talons attached (if so specified in the relevant Final Terms), in an aggregate principal amount equal to the principal amount of the Temporary Global Note to the bearer of the Temporary Global Note against the surrender of the Temporary Global Note to or to the order of the Fiscal Agent within 30 days of the bearer requesting such exchange. If: (a) Definitive Notes have not been duly delivered by 5.00 p.m. (London time) on the thirtieth day after the bearer has requested exchange of the Temporary Global Note for Definitive Notes; or (b) the Temporary Global Note (or any part thereof) has become due and payable in accordance with the Terms and Conditions of the Notes or the date for final redemption of the Temporary Global Note has occurred and, in either case, payment in full of the amount of principal falling due with all accrued interest thereon has not been made to the bearer in accordance with the terms of the Temporary Global Note on the due date for payment, then the Temporary Global Note (including the obligation to deliver Definitive Notes) will become void at 5.00 p.m. (London time) on such thirtieth day (in the case of (a) above) or at 5.00 p.m. (London time) on such due date (in the case of (b) above) and the bearer of the Temporary Global Note will have no further rights thereunder (but without prejudice to the rights which the bearer of the Temporary Global Note or others may have under the Deed of Covenant).

