Text: Each Tranche of Notes in bearer form ("Bearer Notes") will initially be in the form of either a temporary global note in bearer form (the "Temporary Global Note"), without interest coupons, or a permanent global note in bearer form (the "Permanent Global Note"), without interest coupons, in each case as specified in the relevant Final Terms. Each Temporary Global Note or, as the case may be, Permanent Global Note (each a "Global Note") which is not intended to be issued in new global note ("NGN") form, as specified in the relevant Final Terms, will be deposited on or around the issue date of the relevant Tranche of the Notes with a depositary or a common depositary for Euroclear Bank SA/NV ("Euroclear") and/or Clearstream Banking, société anonyme ("Clearstream, Luxembourg") and/or any other relevant clearing system and each Global Note which is intended to be issued in NGN form, as specified in the relevant Final Terms, will be deposited on or around the issue date of the relevant Tranche of the Notes with a common safekeeper for Euroclear and/or Clearstream, Luxembourg. On 13 June 2006 the European Central Bank (the "ECB") announced that Notes in NGN form are in compliance with the "Standards for the use of EU securities settlement systems in ESCB credit _operations" of the central banking system for the euro (the "Eurosystem"), provided that certain other_ criteria are fulfilled. At the same time the ECB also announced that arrangements for Notes in NGN form will be offered by Euroclear and Clearstream, Luxembourg as of 30 June 2006 and that debt securities in global bearer form issued through Euroclear and Clearstream, Luxembourg after 31 December 2006 will only be eligible as collateral for Eurosystem operations if the NGN form is used. In the case of each Tranche of Bearer Notes, the relevant Final Terms will also specify whether United States Treasury Regulation §1.163-5(c)(2)(i)(C) (the "TEFRA C Rules") or United States Treasury Regulation §1.163-5(c)(2)(i)(D) (the "TEFRA D Rules") are applicable in relation to the Notes or, if the Notes do not have a maturity of more than 365 days, that neither the TEFRA C Rules nor the TEFRA D Rules are applicable.

