Text: In a press release dated 22 October 2008, "Evolution of the custody arrangement for international debt _securities and their eligibility in Eurosystem credit operations", the ECB announced that it has assessed_ the new holding structure and custody arrangements for registered notes which the ICSDs had designed in cooperation with market participants and that Notes to be held under the New Safekeeping Structure would be in compliance with the "Standards for the use of EU securities settlement systems in ESCB _credit operations" of the Eurosystem, subject to the conclusion of the necessary legal and contractual_ arrangements. The press release also stated that the new arrangements for Notes to be held in NSS form will be offered by Euroclear and Clearstream, Luxembourg as of 30 June 2010 and that registered debt securities in global registered form held issued through Euroclear and Clearstream, Luxembourg after 30 September 2010 will only be eligible as collateral in Eurosystem operations if the New Safekeeping Structure is used. Each Global Registered Note will either be: (a) in the case of a Note which is not to be held under the New Safekeeping Structure, registered in the name of a common depositary (or its nominee) for Euroclear and/or Clearstream, Luxembourg and/or any other relevant clearing system and the relevant Global Registered Note will be deposited on or about the issue date with the common depositary and will be exchangeable in accordance with its terms; or (b) in the case of a Note to be held under the New Safekeeping Structure, be registered in the name of a common safekeeper (or its nominee) for Euroclear and/or Clearstream, Luxembourg and/or any other relevant clearing system and the relevant Global Registered Note will be deposited on or about the issue date with the common safekeeper for Euroclear and/or Clearstream, Luxembourg. If the relevant Final Terms specifies the form of Notes as being "Global Registered Note exchangeable for Individual Note Certificates", then the Notes will initially be in the form of a Global Registered Note which will be exchangeable in whole, but not in part, for individual Note certificates in registered form ("Individual Note Certificates") in accordance with its terms if Euroclear or Clearstream, Luxembourg or any other relevant clearing system is closed for business for a continuous period of 14 days (other than by reason of legal holidays) or announces an intention permanently to cease business. Whenever the Global Registered Note is to be exchanged for Individual Note Certificates, the Issuer shall procure that Individual Note Certificates will be issued in an aggregate principal amount equal to the principal amount of the Global Registered Note within five business days of the delivery, by or on behalf of the registered holder of the Global Registered Note to the Registrar of such information as is required to complete and deliver such Individual Note Certificates (including, without limitation, the names and addresses of the persons in whose names the Individual Note Certificates are to be registered and the principal amount of each such person's holding) against the surrender of the Global Registered Note at the specified office of the Registrar. Such exchange will be effected in accordance with the provisions of the Agency Agreement and the regulations concerning the transfer and registration of Notes scheduled thereto and, in particular, shall be effected without charge to any holder, but against such indemnity as the Registrar may require in respect of any tax or other duty of whatsoever nature which may be levied or imposed in connection with such exchange. If: (a) Individual Note Certificates have not been delivered by 5.00 p.m. (London time) on the thirtieth day after they are due to be issued and delivered in accordance with the terms of the Global Registered Note; or (b) any of the Notes represented by a Global Registered Note (or any part of it) has become due and payable in accordance with the Terms and Conditions of the Notes or the date for final redemption of the Notes has occurred and, in either case, payment in full of the amount of ----- principal falling due with all accrued interest thereon has not been made to the holder of the Global Registered Note in accordance with the terms of the Global Registered Note on the due date for payment, then the Global Registered Note (including the obligation to deliver Individual Note Certificates) will become void at 5.00 p.m. (London time) on such thirtieth day (in the case of (a) above) or at 5.00 p.m. (London time) on such due date (in the case of (b) above) and the holder of the Global Registered Note will have no further rights thereunder (but without prejudice to the rights which the holder of the Global Registered Note or others may have under the Deed of Covenant. Under the Deed of Covenant, persons shown in the records of Euroclear and/or Clearstream, Luxembourg and/or any other relevant clearing system as being entitled to an interest in a Global Registered Note which becomes void will acquire directly against the Issuer all those rights to which they would have been entitled if, immediately before the Global Registered Note became void, they had been the holders of Individual Note Certificates in an aggregate principal amount equal to the principal amount of Notes they were shown as holding in the records of Euroclear and/or Clearstream, Luxembourg and/or any other relevant clearing system.

