orm, Denomination, Title and Transfer (a) _Bearer Notes: Bearer Notes are in the Specified Denomination(s) with Coupons and, if specified in the relevant Final Terms, Talons attached at the time of issue. In the case of a Series of Bearer Notes with more than one Specified Denomination, Bearer Notes of one Specified Denomination will not be exchangeable for Bearer Notes of another Specified Denomination. (b) _Title to Bearer Notes: Title to Bearer Notes and the Coupons will pass by delivery. In the case of Bearer Notes, "Holder" means the holder of such Bearer Note and "Noteholder" and "Couponholder" shall be construed accordingly. (c) _Registered Notes: Registered Notes are in the Specified Denomination(s), which may include a minimum denomination specified in the relevant Final Terms and higher integral multiples of a smaller amount specified in the relevant Final Terms . (d) _Title to Registered Notes: The Registrar will maintain the register (the "Register") in accordance with the provisions of the Agency Agreement. A certificate (each, a "Note Certificate") will be issued to each Holder of Registered Notes in respect of its registered holding. Each Note Certificate will be numbered serially with an identifying number which will be recorded in the Register. In the case of Registered Notes, "Holder" means the person in whose name such Registered Note is for the time being registered in the Register (or, in the case of a joint holding, the first named thereof) and "Noteholder" shall be construed accordingly. (e) _Ownership: The Holder of any Note or Coupon shall (except as otherwise required by law) be treated as its absolute owner for all purposes (whether or not it is overdue and regardless of any notice of ownership, trust or any other interest therein, any writing thereon or, in the case of Registered Notes, on the Note Certificate relating thereto (other than the endorsed form of transfer) or any notice of any previous loss or theft thereof) and no Person shall be liable for so treating such Holder. No person shall have any right to enforce any term or condition of any Note under the Contracts (Rights of Third Parties) Act 1999. (f) _Transfers of Registered Notes:_ Subject to paragraphs (i) (Closed periods) and (j) (Regulations _concerning transfers and registration) below, a Registered Note may be transferred upon_ surrender of the relevant Note Certificate, with the endorsed form of transfer duly completed, at the Specified Office of the Registrar or any Transfer Agent, together with such evidence as the Registrar or (as the case may be) such Transfer Agent may reasonably require to prove the title of the transferor and the authority of the individuals who have executed the form of transfer;

