Text: (a) the Issuer shall at all times maintain a fiscal agent and a registrar; and (b) the Issuer shall at all times maintain a paying agent in an EU member state that will not be obliged to withhold or deduct tax pursuant to European Council Directive 2003/48/EC on the taxation of savings income or any law implementing or complying with, or introduced in order to conform to, this Directive; and (c) if a Calculation Agent is specified in the relevant Final Terms, the Issuer shall at all times maintain a Calculation Agent; and (d) if and for so long as the Notes are admitted to listing, trading and/or quotation by any competent authority, stock exchange and/or quotation system which requires the appointment of a Paying Agent and/or a Transfer Agent in any particular place, the Issuer shall maintain a Paying Agent and/or a Transfer Agent having its Specified Office in the place required by such competent authority, stock exchange and/or quotation system. Notice of any change in any of the Agents or in their Specified Offices shall promptly be given to the Noteholders. ----- 18. **Meetings of Noteholders; Modification and Waiver (a) _Meetings of Noteholders: The Agency Agreement contains provisions for convening meetings of Noteholders to consider matters relating to the Notes, including the modification of any provision of these Conditions. Any such modification may be made if sanctioned by an Extraordinary Resolution. Such a meeting may be convened by the Issuer and shall be convened by them upon the request in writing of Noteholders holding not less than one-tenth of the aggregate principal amount of the outstanding Notes. The quorum at any meeting convened to vote on an Extraordinary Resolution will be two or more Persons holding or representing one more than half of the aggregate principal amount of the outstanding Notes or, at any adjourned meeting, two or more Persons being or representing Noteholders whatever the principal amount of the Notes held or represented; **provided, however, that Reserved Matters may only be sanctioned by an Extraordinary Resolution passed at a meeting of Noteholders at which two or more Persons holding or representing not less than three-quarters or, at any adjourned meeting, one-quarter of the aggregate principal amount of the outstanding Notes form a quorum. Any Extraordinary Resolution duly passed at any such meeting shall be binding on all the Noteholders and Couponholders, whether present or not. In addition, a resolution in writing signed by or on behalf of all Noteholders who for the time being are entitled to receive notice of a meeting of Noteholders will take effect as if it were an Extraordinary Resolution. Such a resolution in writing may be contained in one document or several documents in the same form, each signed by or on behalf of one or more Noteholders. (b) _Modification: The Notes, these Conditions and the Deed of Covenant may be amended without the consent of the Noteholders or the Couponholders to correct a manifest error. In addition, the parties to the Agency Agreement may agree to modify any provision thereof, but the Issuer shall not agree, without the consent of the Noteholders, to any such modification unless it is of a formal, minor or technical nature, it is made to correct a manifest error or it is, in the opinion of such parties, not materially prejudicial to the interests of the Noteholders. 19. **Further Issues The Issuer may from time to time, without the consent of the Noteholders or the Couponholders, create and issue further notes having the same terms and conditions as the Notes in all respects (or in all respects except for the first payment of interest) so as to form a single series with the Notes. 20. **Notices (a) _Bearer Notes:_ Notices to the Holders of Bearer Notes shall be valid if published in a leading English language daily newspaper published in London (which is expected to be the _Financial _Times) and, if the Bearer Notes are admitted to tra