r relevant clearing system from time to time. For so long as the relevant Notes are represented by a Global Note or Global Registered Note, Accountholders shall have no claim directly against the Issuer in respect of payments due under the Notes and such obligations of the Issuer will be discharged by payment to the holder of such Global Note or Global Registered Note.

