Text: Each Global Note and Global Registered Note will contain provisions which modify the Terms and Conditions of the Notes as they apply to the Global Note or Global Registered Note. The following is a summary of certain of those provisions: _Payments: All payments in respect of the Global Note or Global Registered Note which, according to the_ Terms and Conditions of the Notes, require presentation and/or surrender of a Note, Note Certificate or Coupon will be made against presentation and (in the case of payment of principal in full with all interest accrued thereon) surrender of the Global Note or Global Registered Note to or to the order of any Paying Agent and will be effective to satisfy and discharge the corresponding liabilities of the Issuer in respect of the Notes. On each occasion on which a payment of principal or interest is made in respect of the Global Note, the Issuer shall procure that in respect of a CGN the payment is noted in a schedule thereto and in respect of an NGN the payment is entered pro rata in the records of Euroclear and Clearstream, Luxembourg. _Payment Business Day: In the case of a Global Note, or a Global Registered Note, shall be, if the_ currency of payment is euro, any day which is a TARGET Settlement Day and a day on which dealings in foreign currencies may be carried on in each (if any) Additional Financial Centre; or, if the currency of payment is not euro, any day which is a day on which dealings in foreign currencies may be carried on in the Principal Financial Centre of the currency of payment and in each (if any) Additional Financial Centre. _Payment Record Date: Each payment in respect of a Global Registered Note will be made to the person_ shown as the Holder in the Register at the close of business (in the relevant clearing system) on the Clearing System Business Day before the due date for such payment (the "Record Date") where "Clearing System Business Day" means a day on which each clearing system for which the Global Registered Note is being held is open for business. ----- _Exercise of put option: In order to exercise the option contained in Condition_ 10(e) (‎ _Redemption at the option of Noteholders) the bearer of the Permanent Global Note or the holder of a Global Registered Note_ must, within the period specified in the Conditions for the deposit of the relevant Note and put notice, give written notice of such exercise to the Fiscal Agent specifying the principal amount of Notes in respect of which such option is being exercised. Any such notice will be irrevocable and may not be withdrawn. _Partial exercise of call option: In connection with an exercise of the option contained in Condition 10(c) ‎_ (Redemption at the option of the Issuer) in relation to some only of the Notes, the Permanent Global Note or Global Registered Note may be redeemed in part in the principal amount specified by the Issuer in accordance with the Conditions and the Notes to be redeemed will not be selected as provided in the Conditions but in accordance with the rules and procedures of Euroclear and Clearstream, Luxembourg (to be reflected in the records of Euroclear and Clearstream, Luxembourg as either a pool factor or a reduction in principal amount, at their discretion). _Notices: Notwithstanding Condition_ 20 (‎ _Notices), while all the Notes are represented by a Permanent_ Global Note (or by a Permanent Global Note and/or a Temporary Global Note) or a Global Registered Note and the Permanent Global Note is (or the Permanent Global Note and/or the Temporary Global Note are), or the Global Registered Note is, deposited with a depositary or a common depositary for Euroclear and/or Clearstream, Luxembourg and/or any other relevant clearing system or a common safekeeper, notices to Noteholders may be given by delivery of the relevant notice to Euroclear and/or Clearstream, Luxembourg and/or any other relevant clearing system and, in any case, such notices shall be deemed to have been given to the Noteholders in accordance with Condition 20 (‎ _Notices) on the date of delivery to Euroclear and/or Clearstream, Luxembourg and/or any other relevant clearing system, except that, for so long as such Notes are admitted to trading on the Luxembourg Stock Exchange and it is a requirement of applicable law or regulations, such notices shall be published in a leading newspaper having general circulation in Luxembourg (which is expected to be Luxemburger Wort or the Tageblatt) or published on the website of the Luxembourg Stock Exchange (www.bourse.lu). -----

