obal Registered Note is being held is open for business. ----- _Exercise of put option: In order to exercise the option contained in Condition_ 10(e) (‎ _Redemption at the option of Noteholders) the bearer of the Permanent Global Note or the holder of a Global Registered Note_ must, within the period specified in the Conditions for the deposit of the relevant Note and put notice, give written notice of such exercise to the Fiscal Agent specifying the principal amount of Notes in respect of which such option is being exercised. Any such notice will be irrevocable and may not be withdrawn. _Partial exercise of call option: In connection with an exercise of the option contained in Condition 10(c) ‎_ (Redemption at the option of the Issuer) in relation to some only of the Notes, the Permanent Global Note or Global Registered Note may be redeemed in part in the principal amount specified by the Issuer in accordance with the Conditions and the Notes to be redeemed will not be selected as provided in the Conditions but in accordance with the rules and procedures of Euroclear and Clearstream, Luxembourg (to be reflected in the records of Euroclear and Clearstream, Luxembourg as either a pool factor or a reduction in principal amount, at their discretion). _Notices: Notwithstanding Condition_ 20 (‎ _Notices), while all the Notes are represented by a Permanent_ Global Note (or by a Permanent Global Note and/or a Temporary Global Note) or a Global Registered Note and the Permanent Global Note is (or the Permanent Global Note and/or the Temporary Global Note are), or the Global Registered Note is, deposited with a depositary or a common depositary for Euroclear and/or Clearstream, Luxembourg and/or any other relevant clearing system or a common safekeeper, notices to Noteholders may be given by delivery of the relevant notice to Euroclear and/or Clearstream, Luxembourg and/or any other relevant clearing system and, in any case, such notices shall be deemed to have been given to the Noteholders in accordance with Condition 20 (‎ _Notices) on the date of delivery to Euroclear and/or Clearstream, Luxembourg and/or any other relevant clearing system, except that, for so long as such Notes are admitted to trading on the Luxembourg Stock Exchange and it is a requirement of applicable law or regulations, such notices shall be published in a leading newspaper having general circulation in Luxembourg (which is expected to be Luxemburger Wort or the Tageblatt) or published on the website of the Luxembourg Stock Exchange (www.bourse.lu). -----

