Text: The Issuer is a Danish-based European full-service provider of communications solutions. The Issuer is the leading provider of telecommunications and pay-TV in Denmark, with a market-leading position (both measured by number of customers) in each of its major business segments: landline telephony, internet access, mobility services and pay-TV (source: NITA Report entitled "Telecom Statistics - First _Half of 2011"). Outside of Denmark, the Issuer has a significant presence in the pan-Nordic_ telecommunications market. In 2006, the Issuer embarked on a strategy to concentrate on its core Nordic markets and to become a clear and focused Nordic telecommunications operator through strategic in-country consolidation and divestments of its non-Nordic‎international‎assets.‎Going‎forward‎the‎Issuer’s‎M&A‎policy‎is‎to‎focus‎on‎ bolt-on, in-country acquisitions in Denmark and the other Nordic countries. The Issuer's legal and commercial names are TDC A/S and TDC, respectively. The Issuer was incorporated as an "aktieselskab" (public limited liability company) on 14 November 1990 and is organised under the laws of the Kingdom of Denmark (its Central Business Registration number in Denmark is 1477 3908). The Issuer is headquartered at Teglholmsgade 3, DK-0900 Copenhagen C, Denmark (telephone: +45 66 63 77 77). The Issuer's shares are listed on the Nasdaq OMX Copenhagen Exchange (ISIN DK0060228559). The objects of the Issuer are to conduct business within communications, services, directories, media, investment, financing, advisory services, trade and any other related business, whether in Denmark or abroad, if appropriate in the form of joint ventures with other Danish or foreign-based companies, as specified in paragraph 3 of the Issuer's Articles of Association. The Issuer's current Articles of Association were adopted by the Issuer's annual general meeting on 9 March 2011. TDC was partly privatised in 1994 and fully privatised in 1998. TDC's largest shareholder, NTC Holding G.P. & CIE S.C.A. ("NTC") is, through its parent company NTC Parent S.à r.l., controlled by investment funds, each of which is advised or managed, directly or indirectly, by Apax Partners LLP, The Blackstone Group, Kohlberg Kravis Roberts & Co. L.P., Permira Advisers KB or Providence Equity Partners Limited (see "Major Shareholders" below).

