Text: As at 31 December 2011, the Issuer and its subsidiaries (the "TDC Group") had a total of 9.0 million RGUs, up 1.7 per cent. from 31 December 2010. As at 31 December 2011, the TDC Group had 8,740,000 domestic RGUs, up from 8,590,000 as at 31 December 2010. This increase was attributable mainly to the acquisition of Onfone (constituting 206,000 RGUs as of 31 December 2011), partly offset by fewer landline voice RGUs, which decreased by 8.2 per cent. during this period due to customer migration from landline to mobile services. The number of RGUs in Nordic increased by 14.8 per cent. or 34,000 from year-end 2010 to year-end 2011, through growth primarily within mobile RGUs, which increased by 28.4 per cent., but also due to an increase in landline and internet RGUs.

