Title: Business Lines
Text: The TDC Group's main business lines are as follows: _Consumer_ For the year ended 31 December 2011, Consumer's revenue was DKK 9,024 million, constituting 33 per cent. of the TDC Group's total external revenue excluding eliminations. As at 31 December 2011, Consumer had 1,996 full-time employee equivalents. Consumer is the leading provider of landline and mobile services to residential and SoHo (Small Office/Home Office, which refers to a category of business which is defined by, among other things, having fewer than two employees and with limited revenue (of less than DKK 30,000) during the last year) customers in Denmark. The Consumer division services the mass to premium market through the TDC brand and offers landline services including PSTN and VoIP telephony, xDSL broadband, TVoIP, CPE and various value added services, for example, music and security services, whereas the mobile communications services consist of subscription and prepaid voice and data services, mobile broadband and content. Using the TDC brand, Consumer also provides the broadband-based multi-play products, TDC HomeTrio (Digital IP TV, internet access and landline telephony) and TDC HomeDuo (internet access and landline telephony). Consumer also comprises the fixed-mobile convergence product Duét, TDC Shops, Customer Centre including directory services, Telmore A/S ("Telmore"), Fullrate A/S ("Fullrate"), M1 A/S ("M1") and Onfone ApS ("Onfone"). Telmore offers mobile voice, mobile broadband and ADSL products (Telmore has ceased to offer broadband to new customers, but has continued to provide broadband to its pre-existing broadband customers). Fullrate offers self-service xDSL broadband, TVoIP, VoIP, mobile voice and mobile broadband products. M1 offers SIM-only products and its commercial strategy is based on competitive price plans. Onfone offers mobile voice and mobile broadband, also based on competitive price plans. Onfone was acquired in May 2011. _Business_ For the year ended 31 December 2011, Business had a total revenue of DKK 7,517 million, constituting 27 per cent. of the TDC Group's total external revenue excluding eliminations. As at 31 December 2011 ----- Business had 1,344 full-time employee equivalents. Business provides telecommunications solutions for the TDC Group's business customers in Denmark. Business has a market leading position in the Danish business market (source: NITA Report entitled "Telecom Statistics - First Half of 2011") and provides telecommunications solutions for small, medium and large businesses and organisations, as well as the public sector in Denmark. Its activities include broadband solutions, landline telephony, mobile services, convergence products (combined landline and mobile telephony), and fibre access. Business also provides terminal equipment and systems integration services through its subsidiary NetDesign A/S ("NetDesign"), which is a Danish systems integrator of IP-based communications solutions offering networks, security, video conferencing and telephony systems tailored to business customers and other organisations. _Nordic_ For the year ended 31 December 2011, Nordic had a total revenue of DKK 4,487 million, constituting 16 per cent. of the TDC Group's total external revenue excluding eliminations. At year-end 2011, Nordic had 1,473 full-time employee equivalents. Nordic provides landline telephony, mobile telephony (through MVNO and service provider agreements), internet and network, including IP-VPN services (IP-based Virtual Private Network, which is a network that enables organisations to use a shared network to connect remote sites or users together) and system integration services (only in Sweden) to the public sector and large and mid-size enterprises in Sweden, Norway and Finland primarily based on a direct sales model. Through TDC Hosting A/S, TDC Hosting AB and TDC Hosting OY, Nordic also offers hosting and information technology operations solutions in Denmark, Sweden and Finland, with a primary focus on providing managed hosting, co-location and shared hosting to small and medium sized businesses. _Wholesale_ For the year ended 31 December 2011, Wholesale's revenue was DKK 2,153 million, constituting 8 per cent. of the TDC Group's total external revenue excluding eliminations. As at 31 December 2011, Wholesale had 190 full-time employee equivalents. Wholesale provides landline telephony, mobile services (including convergence), and internet and network services for external service providers and brand partners, as well as national and international traffic and roaming for other network operators. As a content provider service, Wholesale handles sales, consulting and business development within mobile data services, for example mobile payment, barcodes, telemetrics and mobile marketing. Wholesale also provides a variety of access services such as full and shared unbundled access to the local loop, BSA and resale of ISDN and xDSL services. Furthermore, Wholesale offers infrastructure services, including traditional leased lines, IP-VPN, dedicated fibre, including national and international Network Capacity Services, wavelengths and IP connectivity, and sells co-location to approximately 1,200 TDC telephone exchanges. _YouSee A/S (subsidiary)_ For the year ended 31 December 2011, YouSee's revenue was DKK 4,259 million, constituting 15 per cent. of the TDC Group's total external revenue excluding eliminations. As at 31 December 2011, YouSee had 1,218 full-time employee equivalents. YouSee is the leading Danish cable-TV provider in terms of market share, and offers individual households and organised customers (such as antenna and housing associations) home entertainment and telecommunications solutions. YouSee offers cable TV, mobile broadband and telephony and add on services, through a fully digitalised hybrid fiber coaxial-cable network. _Operations & Headquarters_ For the year ended 31 December 2011, Operations & Headquarters had a total revenue of DKK 287 million, constituting 1 per cent. of the TDC Group's total external revenue excluding eliminations. As at 31 December 2011, Operations & Headquarters had 3,596 full-time employee equivalents. Operations operates TDC's Danish fixed-line and mobile networks and is responsible for fault correction, installation and network, and information technology, and supports TDC's other business divisions by operating support and back-office functions. Operating expenses in Operations corresponding to other segments use of the infrastructure and supply functions are allocated to the relevant business lines (except for YouSee A/S ("YouSee") and Nordic, which are billed at arms' length). Operations' revenue generated from third parties mainly relates to police assignments, operation of mobile sites and supply chain management. Headquarters provides internal services for the TDC Group's domestic business lines. Headquarters also ----- undertakes the TDC Group's staff functions including finance, legal and regulatory, human resources and communications.

