Text: _Insurance_ The Issuer and its Danish and foreign subsidiaries maintain insurance covering property/business interruption, professional liability/general and product liability, terrorism insurance, directors and officers liability and crime insurance. Furthermore, the Issuer and its Danish subsidiaries maintain insurances covering workers compensation, group accident insurance, motor vehicle insurance, business travel insurance‎and‎expatriate‎insurance.‎Based‎on‎its‎risk‎analysis,‎the‎Issuer’s‎policy‎has‎been‎to‎not‎insure‎its‎ underground, air and sea cables. The Issuer believes that its current insurance policies provide adequate coverage for its business, including‎protection‎for‎the‎nature‎and‎amount‎of‎risks‎the‎Issuer‎faces.‎The‎Issuer’s‎foreign‎subsidiaries‎ have motor vehicle and personnel-related insurance in place locally. These are not controlled by the Issuer’s‎central‎risk‎management‎function. _Operational Risk Management_ The Issuer has a central risk management function and a corporate security function which handle operational risk management in TDC. Additionally, each TDC subsidiary has appointed employees responsible for security and insurance issues who work closely together with the central Risk Management function. The risk management activities are governed largely by a corporate insurance policy and a corporate security policy. The aim of the central risk management and corporate security functions is to systematically identify and reduce‎risks‎relating‎to‎TDC’s‎assets,‎activities,‎and‎employees.‎It‎is‎the‎Issuer’s‎policy‎to‎continuously reduce risks in general and to transfer catastrophe risks to insurance companies. As part of the risk management strategy, a comprehensive annual risk survey program is conducted in close cooperation with external risk engineers. Insurance coverage is based on identified risk scenarios and insurance conditions available from insurance markets in Denmark and abroad. The amount of self-retention‎of‎risk‎in‎TDC’s‎insurance‎programs‎has‎been‎determined‎based‎on‎the‎risk‎ assessment related to each individual area and the subsequent level of insurance premiums. -----

