irectors of Højgaard Holding ----- Name and Role Principal Outside Activities A/S and MT Højgaard A/S. Member of the Central Board of Directors of the Confederation of Danish Industry. Søren Thorup Sørensen is a member of the Board of Directors Kurt Björklund is a member of the Board of Directors Lawrence Guffey is a member of the Board of Directors Henrik Kraft is a member of the Board of Directors Gustavo Schwed is a member of the Board of Directors Andrew Sillitoe is a member of the Board of Directors Chairman of the Boards of Directors of K & C Holding A/S, Toginfo A/S, EP af 27. april 2006 A/S, KIPAL 2007 ApS and Kirkbi Anlæg A/S. Member of the Boards of Directors of Falck Holding A/S, Falck A/S, Falck Danmark A/S, Topdanmark A/S, Topdanmark Forsikring A/S, LEGO A/S, Koldingvej 2, Billund A/S, Kirkbi Real Estate Investment A/S, Kirkbi AG, Interlego AG, LEGO Juris A/S and Kirkbi Invest A/S. Chief Executive Officer of Kirkbi A/S and Kirkbi Invest A/S. Co-Managing Partner in Permira. Member of the Board of Directors of Permira Holdings Limited and member of the Executive Group and Investment Committee. Senior‎ Managing‎ Director‎ in‎ Blackstone’s‎ Corporate‎ Private Equity Group. Member of the Boards of Directors of Axtel SA de CV, Deutsche Telekom AG, Paris Review, the Literary Foundation and the Humanities Advisory Board at Rice University. Partner of KKR. Manager of NTC Parent S.à.r.l. and NTC Holding G.P. S.à.r.l. Director of Ambea Holding AB, Ambea AB and Carema Hold-ing AB. Chairman of the Supervisory Board of Versatel AG. Member of the Audit Committee of Versatel AG. Chaiman of the Human Resources and Nomination Committee of Versatel AG. Managing Director of Providence Equity. Member of the Boards of Directors of Decision Resources Group and Grupo TorreSur. Member of the Board of Managers at Swarthmore College. Partner of Apax Partners LLP and member of the Executive Committee and Investment Committee. ----- Name and Role Principal Outside Activities Member of the Board of Directors of Apax Europe VI No. 2 Nominees Ltd., Apax Europe VI Nominees Ltd., Apax Europe VII Nominees Ltd., Apax PP Nominees Ltd., Apax WW No 2 Nominees Ltd., Apax WW Nominees Ltd. and Apax US VII Nominees Ltd. Lotte Broder Jørgensen is an employee elected member of the Board of Directors Steen M. Jacobsen is an employee elected member of the Board of Directors Jan Bardino is an employee elected member of the Board of Directors Bo Magnussen is an employee elected member of the Board of Directors Customer Adviser at TDC A/S. Specialist Technician at TDC A/S. Member of the Boards of Directors of TDC Pensionskasse and Teglholm Park A/S. IT Project Manager at TDC A/S. Senior Clerk at TDC A/S. Chairman of Lederforeningen at TDC (Association of Managers and Employees in Special Positions of Trust). The members of the Executive Committee are stated in the table below. In accordance with the Danish Companies Act and the Articles of Association of the Issuer, the members of the Executive Committee are appointed by the Board of Directors. In accordance with the Danish Companies Act and the Articles of Association of the Issuer, the Executive Committee is in charge of the day-to-day management of the Issuer. The day-to-day management does not cover matters of material importance to the Issuer. Such matters require submission by the Executive Committee to the Board of Directors for approval, unless Board approval cannot be obtained without considerable inconvenience to the Issuer's business. Name and Role Principal Outside Activities Henrik Poulsen is the President and Chief Executive Officer of TDC A/S Member of the Boards of Directors of Chr. Hansen Holding A/S, the Denmark-America Foundation, and Falck A/S. Pernille Erenbjerg is a Senior Executive Vice President and Chief Financial Officer Member of the Board of Directors of the Royal Danish Theatre. Eva Berneke is a Senior Executive Vice Member of the Boards of Directors of Copenhagen President, President of Wholesale Business School, LEGO A/S and Schibsted ASA. Member of the Danish Council for Technology and Innovation. Niels Breining is a Senior Executive Vice President, TDC A/S and CEO of YouSee A/S Chairman of the Media Council of the Confederation of Danish Industry. Carsten Dilling is a Senior Executive Vice Chairman of the Boards of Directors of Traen A/S and President, Chief Operating Officer, President Traen of Operations Holding A/S. Executive manager in CDI Consult ApS. Miriam Hvidt is a Executive Vice President, N/A Stakeholder Relations Anders Jensen is a Senior Executive Vice N/A President, President of Consumer Inger Ørum Kirk is a Senior Executive Vice Chairman of the Board of Directors of the Danish Post President, People & Culture and ----- Name and Role Principal Outside Activities Tele museum. Martin Lippert is a Senior Executive Vice President, President of Business Jens Munch-Hansen is a Senior Executive Vice President, President of Nordic Member of the Board of Directors of Halberg A/S, including three subsidiaries thereof. Member of the Board of Directors of Scan Jour A/S. The Board of Directors has set up an Audit Committee, a Compensation Committee and a Nomination Committee. The Audit Committee consists of Søren Thorup Sørensen (Chairman), Vagn Sørensen, Lawrence Guffey and Andrew Sillitoe. The Audit Committee assists the Board of Directors with activities including: (i) monitoring the financial reporting‎process,‎(ii)‎monitoring‎the‎efficiency‎of‎TDC’s‎internal‎control‎system‎ and any internal auditing and risk management systems, (iii) monitoring the statutory audit of the annual report,‎(iv)‎appointing‎TDC’s‎independent‎auditors‎and‎monitoring‎and‎checking‎the‎independence‎of‎the‎ auditors, including in particular the delivery of non-audit services to TDC. In 2011, the Audit Committee held three meetings. The Compensation Committee consists of Vagn Sørensen (Chairman), Pierre Danon, Lars Rasmussen, Henrik Kraft and Gustavo Schwed. The Compensation Committee approves the compensation and other terms of employment for the members‎of‎TDC’s‎Executive‎Committee‎as‎well‎as‎the framework of the TDC‎Group’s‎incentive‎programme.‎This includes determination of targets for the annual bonus to the members of the Executive Committee and approval of payment of such bonus. The Compensation Committee also proposes to the Board of Director the size of the Board of Directors’‎ fee,‎ which‎ is‎ approved at the Annual General Meeting. In 2011, the Compensation Committee held three meetings. The Nomination Committee consists of the same members as the Compensation Committee and is also chaired by Vagn Sørensen. The Nomination Committee assists the Board of Directors with activities including: (i) identification of and recommendation to the Board of Directors of candidates for the Board of Directors; (ii) recommendation to the Board of Directors of candidates for the Executive Committee based on proposals made by the Chief Executive Officer, and (iii) review of and recommendation to the Board of‎ Directors‎ concerning‎ adoption‎ of‎ TDC’s‎ position‎ on‎ the Recommendations for Corporate Governance issued by the Committee on Corporate Governance and the Guidelines for responsible ownership and good corporate governance issued by the Danish Venture Capital and Private Equity Association. In 2011, the Nomination Committee held three meetings. The business address of all the above mentioned members is Headquarters, TDC A/S, Teglholmsgade 3, DK-0900 Copenhagen C, Denmark. There are no conflicts of interest between the duties of the persons listed above to the Issuer and their private interests or other duties. -----

