Title: Withholding Tax
Text: All payments of interest and principal by the Issuer in the context of the holding, disposal, redemption or repurchase of the Notes can be made free and clear of any withholding or deduction for or on account of any taxes of whatsoever nature imposed, levied, withheld, or assessed by Luxembourg or any political subdivision or taxing authority thereof or therein, in accordance with the applicable Luxembourg law, subject however to: (i) the application of the Luxembourg laws of 21 June 2005 implementing the EU Savings Tax Directive in the form of interest payments and ratifying several agreements concluded with certain dependent or associated territories and providing for the possible application of a withholding tax (35 per cent. from 1 July 2011) on interest paid to certain non Luxembourg resident investors (individuals and certain types of entities called "residual entities" within the meaning of article 4.2 of the EU Savings Tax Directive) in the event of the Issuer appointing a paying agent in Luxembourg within the meaning of the above-mentioned directive (see section "EU Savings Tax Directive" below) or agreements; (ii) the application as regards Luxembourg resident individuals of the Luxembourg law of 23 December 2005 which has introduced a 10 per cent. withholding tax on savings income (i.e., with certain exemptions, savings income within the meaning of the Luxembourg laws of 21 June 2005 implementing the EU Savings Tax Directive). Pursuant to the law of 23 December 2005 as amended by the law of 17 July 2008, Luxembourg resident individuals can opt to self declare and pay a 10 per cent. tax on interest payments made by paying agents located in a Member State of the European Union other than Luxembourg, a Member State of the European Economic Area or in a State or territory which has concluded an agreement directly relating to the EU Savings Tax Directive. The 10 per cent. withholding tax as described above or the 10 per cent tax are final when Luxembourg resident individuals are acting in the context of the management of their private wealth. Responsibility for the withholding of tax in application of the above-mentioned Luxembourg laws of 21 June 2005 and 23 December 2005 is assumed by the Luxembourg paying agent within the meaning of these laws and not by the Issuer.

