Text: On 3 June 2003, the EU Council of Economic and Finance Ministers adopted a directive regarding the taxation of savings income (the "EU Savings Tax Directive"). The EU Savings Tax Directive is, in principle, applied by Member States as from 1 July 2005 and has been implemented in Luxembourg by the laws of 21 June 2005. Under the EU Savings Tax Directive, each Member State is required to provide to the tax authorities of another Member State details of payments of interest or other similar income, within the meaning of the EU Savings Tax Directive, paid by a paying agent within the meaning of the EU Savings Tax Directive to an individual resident or certain types of entities called "residual entities", within the meaning of the EU Savings Tax Directive (the "Residual Entity" or "Residual Entities"), established in that other Member State (or certain dependent or associated territories). For a transitional period, however, Austria and Luxembourg are permitted to apply an optional information reporting system whereby if a beneficial owner, within the meaning of the EU Savings Tax Directive, does not comply with one of two procedures for information reporting, the relevant Member State will levy a withholding tax on payments to such beneficial owner. The withholding tax system applies for a transitional period during which the rate of the withholding is 35 per cent. as from 1 July 2011. The transitional period is to terminate at the end of first full fiscal year following agreement by certain nonEU countries to the exchange of information relating to such payments. Also with effect from 1 July 2005, a number of non-EU countries (Switzerland, Andorra, Liechtenstein, Monaco and San Marino) and certain dependent or associated territories (Jersey, Guernsey, Isle of Man, Montserrat, British Virgin Islands, Netherlands Antilles, Aruba, Turk and Caïcos, Anguilla and the Cayman Islands) have agreed to adopt similar measures (either provision of information or transitional withholding) in relation to payments made by a paying agent (within the meaning of the EU Savings Tax ----- Directive) within its jurisdiction to, or collected by such a paying agent for, an individual resident or a Residual Entity established in a Member State. In addition, Luxembourg has entered into reciprocal provision of information or transitional withholding arrangements with those dependent or associated territories in relation to payments made by a paying agent (within the meaning of the EU Savings Tax Directive) in a Member State to, or collected by such a paying agent for, an individual resident or a Residual Entity established in one of those territories. The European Commission has announced on 13 November 2008 proposals to amend the EU Savings Tax Directive. If implemented, the proposed amendments would, _inter alia, (i) extend the scope of the EU Savings Tax Directive to payments made through certain intermediate structures (whether or not established in an EU Member State) for the ultimate benefit of EU resident individuals, and (ii) provide for a wider definition of interest subject to the EU Savings Tax Directive. The European Parliament approved an amended version of this proposal on 24 April 2009. Investors who are in any doubt as to their position should consult their professional advisers. -----

