g more channels of 64 kbps over the existing regular phone line, which can be used for either integrated voice and data or solely data transmission. An ISDN modem is necessary to connect to the network. The ISDN technology enables 230 channels at the same line. "kbps" means kilobits per second. "LAN" or "local area network" refers to a short-distance data communications network (typically within a company) used to link computers, which allows data and printer sharing. "LTE" or "long term evolution" means a set of enhancements to UMTS designed to increase capacity and speed on mobile telephone networks. "MNO" or "mobile network operator" means a company that has frequency allocation(s), as opposed to a MVNO, and all the required infrastructure to run an independent mobile network. "MVNO" or "mobile virtual network operators" means a mobile operator that does not have frequency allocation. MVNOs have business arrangements with MNOs to buy traffic and data for sale to their own customers. "OTT" or "over the top" refers to online delivery of video and audio without the internet service provider being involved in the control or distribution of the content itself. "OPEX" means operational expenditure. "PABX" or "private automatic branch exchange" is an automatic telephone switching system within a private enterprise. Originally, such systems - called private branch exchanges (PBX) - required the use of a live operator. As today almost all private branch exchanges are automatic, the abbreviation PBX has been extended to PABX. "Prepaid" means when the customer pays for a specified amount of credit for services upfront. The credit then diminishes as the customer uses the service. TDC considers online systems with prepayment characteristics to be mobile voice subscriptions, as users create accounts and generally remain subscribers longer. As a result, customers at Telmore and M1 are considered as mobile voice subscriptions. "PSTN" or "public switched telephone network" means the telecommunications network based on copper lines carrying analogue voice and data - traditional landline telephony. "RGU" means the total number of customer relationships that generate revenue for TDC, including customers with subscription and customers without subscriptions calculated according to the following general principles: Landline customers who have generated revenue within the last 3 months; prepaid cards used at least once within the last 3 months; dial-up internet customers who accessed the internet at least once within the last 3 months. TDC's RGU statement includes the number of main products sold by TDC's residential, business and wholesale segments. The number of customers is not equal to the number of subscribers. An enterprise with 100 mobile voice subscriptions from TDC will be included as 100 RGUs in the RGU statement. As regards wholesale customers, a broadband provider with 20,000 BSA connections from TDC will be included as 20,000 RGUs. For other networks and data connections, the RGU category that is part of TDC's RGU base includes ULL, leased lines, fibre and data connection. Mobile broadband RGUs include mobile data cards and mobile broadband subscriptions. Dual- and tripleplay bundles are included as two and three RGUs, respectively, in the total RGU figures. A YouSee TV customer subscribing to the digital TV add-on product YouSee Plus will be included as two TV RGUs. The term "RGU" does not reflect the number of actual end-users, e.g., an ISDN30 connection counts only as one RGU in TDC's customer base even though this product may involve 30 end-users. "SDH" or "Synchronous Digital Hierarchy" means a standard technology for synchronous data transmission on optical media and provides faster and less-expensive network interconnection than traditional PDH (Plesiochronous Digital Hierarchy) equipment. In digital telephone transmission, synchronous means that the bits from one call are carried within one transmission frame. Plesiochronous means "almost synchronous" or a call that must be extracted from more than one transmission frame. ----- "SHDSL" or "Symmetric High-speed Digital Subscriber Line" means DSL technology with symmetric data transmission. "Triple-play" means the bundling of telephony, internet and TV services through one access channel only. Triple play bundles are included as three customers in the total customer figures. A triple-play subscription must entail all three services. "TV" means television. "TVoIP" or "TV over internet protocol" means a system through which digital TV service is delivered using the internet and internet broadband access networks instead of being delivered through the traditional radio frequency broadcast, satellite signal or cable TV formats. TVoIP can be either IP TV or Web TV. "ULL" or "unbundled local loop" means copper lines to which competing carriers have been granted access by the incumbent operator, allowing such alternative carriers to offer data transmission capacity and/or telephony to end users. (ULL is often referred to as raw copper.) Full ULL is used for customers without PSTN/ISDN subscription (wholesale or retail at TDC), shared ULL is used for customers with PSTN/ISDN subscriptions. "UMTS" or "universal mobile telecommunications systems" means a 3G network designed to provide a wide range of voice, high-speed data and multimedia services. "VDSL" means a DSL technology that provides faster data transmission than other DSL technologies over copper wires. "VoD" or "video-on-demand" refers to transmission delivery of video (films or other video content) to a single user on request. "VoIP" or "voice over internet protocol" means a telephone call over the internet. VoIP can be either with quality of service, i.e., guarantee of call quality comparable to PSTN, achieved through prioritising the traffic. Alternatively, VoIP can be computer to computer calls, with unprioritised traffic. This traffic is generally of a lower quality and is affected by general network usage and will be interrupted by network congestion. TDC VoIP is with quality of service. "WAN" or "wide area network" refers to a long-distance data communications network and is a geographically dispersed collection of LANs. The internet, for instance, is a WAN, but a network between a company's divisions can also be a WAN. "xDSL" means a family of technologies that provides digital data transmission over copper wires. See also ADSL, VDSL and SHDSL. -----

